import React from 'react';
import Routing from "./component/Routing"
import { BrowserRouter as Router } from "react-router-dom";
import {Container} from 'react-bootstrap';

function App() {
  return (

    <Container fluid>
      <Router>
        <Routing />
      </Router>
    </Container>

  );
}

export default App;
